import React from 'react';
import Styles from "./FeatureBlock.module.scss";

const FeatureBlock = () => {
    return (
        <div className={Styles.Feature}>
            <div className={Styles.title}>Легко встраиваемся <br/>
                в инфраструктуру компаний
            </div>
            <div></div>
        </div>
    );
};

export default FeatureBlock;
